import React, { Component } from "react";
import About from "../../components/About";
import Wrapper from "../../components/Wrapper";


class Home extends Component {
  render() {
    return (
      <div>
        <hr></hr>
        <Wrapper>
          <div>
            <h1> Hello World</h1>
            <h2> Good Bye World</h2>
          </div>
        </Wrapper>
        {/* <About title="About Us!" /> */}
      </div>
    );
  }
}

export default Home;
